import React, { useState } from 'react';
import Calendar from 'react-calendar';
import 'react-calendar/dist/Calendar.css';
import '../components/assets/MyCalendar.css'; // Archivo CSS personalizado


const CalendarioDesplegable = ({ fechaInicio, fechaFin }) => {
    const minDate = new Date(fechaInicio);
    const maxDate = new Date(fechaFin);
  
    return (
      <div>
        <h1>Calendario</h1>
        <Calendar
          minDate={minDate}
          maxDate={maxDate}
          view={'month'}
          activeStartDate={minDate}
          activeEndDate={maxDate}
          tileContent={({ date, view }) =>
            view === 'month' && date >= minDate && date <= maxDate ? (
              <div className="highlighted-date"></div>
            ) : null
          }
        />
      </div>
    );
  };

export default CalendarioDesplegable;
